(2, '2019-03-18 10:37:31', '2024-04-05 22:57:23', 1, 1, '[ru_RU:]Выгодный обмен[:ru_RU][en_US:]Profitable exchange[:en_US]', '[ru_RU:]Качественно меняем валюту онлайн.[:ru_RU][en_US:]Qualitatively change the currency online.[:en_US]', '', '/wp-content/themes/newexchanger2.0/images/adv1.svg', 0, 1),
(3, '2019-03-18 10:40:04', '2024-04-05 22:57:40', 1, 1, '[ru_RU:]Надежность на высоком уровне[:ru_RU][en_US:]High level reliability[:en_US]', '[ru_RU:]Если что-то пошло не так, мы всегда вернем вам деньги.[:ru_RU][en_US:]If something went wrong, we will always refund your money.[:en_US]', '', '/wp-content/themes/newexchanger2.0/images/adv2.svg', 0, 1),
(4, '2019-03-18 10:43:57', '2024-04-05 22:57:59', 1, 1, '[ru_RU:]Быстрый обмен[:ru_RU][en_US:]Fast exchange[:en_US]', '[ru_RU:]Мы обеспечим не только надежность и лучший курс, но и за быстрый обмен.[:ru_RU][en_US:]We will provide not only reliability and the best rate, but also for quick exchange.[:en_US]', '', '/wp-content/themes/newexchanger2.0/images/adv4.svg', 0, 1),
(5, '2019-03-18 10:47:26', '2024-04-05 22:58:17', 1, 1, '[ru_RU:]Много направлений обмена[:ru_RU][en_US:]A lot of exchange directions[:en_US]', '[ru_RU:]Совершаем обмены в самых популярных направлениях. Вы всегда сможете обменять свои средства.[:ru_RU][en_US:]We make exchanges in the most popular destinations. You can always exchange your funds.[:en_US]', '', '/wp-content/themes/newexchanger2.0/images/adv3.svg', 0, 1),
(6, '2019-03-18 10:49:33', '2024-04-05 22:58:35', 1, 1, '[ru_RU:]100% гарантия обмена[:ru_RU][en_US:]100% exchange guarantee[:en_US]', '[ru_RU:]Многочисленные положительные отзывы подтверждают высокое качество нашей работы.[:ru_RU][en_US:]Numerous positive reviews confirm the high quality of our work.[:en_US]', '', '/wp-content/themes/newexchanger2.0/images/adv5.svg', 0, 1),
(8, '2019-03-18 10:52:34', '2024-04-05 22:58:52', 1, 1, '[ru_RU:]Экономичный обмен[:ru_RU][en_US:]Economic exchange[:en_US]', '[ru_RU:]У нас всегда лояльные курсы. Мы всегда открыты к сотрудничеству, обращайтесь.[:ru_RU][en_US:]We always have loyal rates. We are always open to cooperation, please contact.[:en_US]', '', '/wp-content/themes/newexchanger2.0/images/adv6.svg', 0, 1);
