(284, 'pn_version', 'a:3:{s:4:\"text\";s:978:\"[ru_RU:]Доступно обновление 2.6\n\nСписок изменений находится по ссылке https://premium.gitbook.io/main/pered-nachalom-raboty/instrukciya-po-obnovleniyu-skripta/spisok-obnovlenii\n\nИнструкция по обновлению доступна по ссылке https://premium.gitbook.io/main/pered-nachalom-raboty/instrukciya-po-obnovleniyu-skripta/obnovlenie-s-versii-2.5-do-2.6[:ru_RU][en_US:]Updаte to 2.6 is available\n\nThe list of changes is available at the link https://premium-gitbook-io.translate.goog/main/pered-nachalom-raboty/instrukciya-po-obnovleniyu-skripta/obnovlenie-s-versii-2.5-do-2.6?_x_tr_sl=ru&_x_tr_tl=en&_x_tr_hl=ru&_x_tr_pto=wapp&_x_tr_hist=true\n\nUpdаte instructions are available at the link https://premium-gitbook-io.translate.goog/main/pered-nachalom-raboty/instrukciya-po-obnovleniyu-skripta/obnovlenie-s-versii-2.5-do-2.6?_x_tr_sl=ru&_x_tr_tl=en&_x_tr_hl=ru&_x_tr_pto=wapp&_x_tr_hist=true[:en_US]\";s:7:\"version\";s:3:\"2.6\";s:4:\"news\";a:1:{i:78;a:2:{s:5:\"title\";s:149:\"[ru_RU:]Воздержитесь от обновления до WordPress 6.7+[:ru_RU][en_US:]Please refrain from upgrading to WordPress 6.7+[:en_US]\";s:4:\"text\";s:521:\"[ru_RU:]Натекущий момент обновление сайта до WordPress 6.7 и выше - не рекомендуется! Это нарушит работу сайта. Ожидайте дополнительного уведомления о возможности обновить WordPress.[:ru_RU][en_US:]At the moment, updating the site to WordPress 6.7 and above is not recommended! This will disrupt the website. Wait for additional notification about the possibility of updating WordPress.[:en_US]\";}}}', 'yes'),
