(491, 'mho_change', 'a:11:{s:11:\"blocreviews\";i:1;s:8:\"partners\";i:1;s:9:\"lastobmen\";i:1;s:6:\"wtitle\";s:0:\"\";s:6:\"ititle\";s:117:\"[ru_RU:]Приветствуем на сайте обменного пункта![:ru_RU][en_US:]Dear guests![:en_US]\";s:5:\"wtext\";s:0:\"\";s:5:\"itext\";s:3175:\"[ru_RU:]Наш On-line сервис предназначен для тех, кто хочет быстро, безопасно и по выгодному курсу обменять такие виды электронных валют: Webmoney, Perfect Money, Qiwi, PayPal, Яндекс. Деньги, Альфа-Банк, ВТБ 24, Приват24, Visa/Master Card, Western uniоn, MoneyGram.\n\nЭтим возможности нашего сервиса не ограничиваются. В рамках проекта действуют программа лояльности, накопительная скидка и партнерская программа, воспользовавшись преимуществами которых, вы сможете совершать обмен электронных валют на более выгодных условиях. Для этого нужно просто зарегистрироваться на сайте.\n\nНаш пункт обмена электронных валют – система, созданная на базе современного программного обеспечения и содержащая весь набор необходимых функций для удобной и безопасной конвертации наиболее распространенных видов электронных денег. За время работы мы приобрели репутацию проверенного партнера и делаем все возможное, чтобы ваши впечатления от нашего сервиса были только благоприятными.[:ru_RU][en_US:]Our website is dedicated to those who wish to exchange own currency in a luxurious way! We welcome you on our grounds and hope that our online service will deliver you the most awesome experience you ever had. Our major point is to provide our clients the safest and quickest method to make transactions using each of the following payment systems: Webmoney, Perfect Money, LiqPay, Pecunix, Payza, Visa/Master Card, Western uniоn, MoneyGram. \n\nMoreover, we are also pleased to inform you that here you are to encounter the best rates on the whole net. Be sure to know that we provide much more useful and popular up-to-date services among which you are to encounter affiliate programs and additional discounts as well as loyalty program. All these services will provide you to trade your currency in the most profitable ways and under the best conditions. All you need to do is register on our website and start to burn financial skies.\n\nAt last, we are pleased to announce you that our exchange system of electronic currencies based on the up-to-date software and willing to provide you with the most awesome functions, you might need for convenient and safest converting any type of electronic currency you possess. Note that our team already gained a reputation as a trusted partner and is well known worldwide. For now, we are willing to do our best for you as well as for your wallet to provide the next-level experience and positive emotions.[:en_US]\";s:8:\"hidecurr\";s:0:\"\";s:9:\"blocknews\";i:1;s:7:\"catnews\";i:0;s:10:\"advantages\";i:1;}', 'yes'),
