(60, 'naps_temp', 'description_txt', '[ru_RU:]Для обмена вам необходимо выполнить несколько шагов:\n<ol>\n	<li>Заполните все поля представленной формы. Нажмите кнопку «Обменять».</li>\n	<li>Ознакомьтесь с условиями договора на оказание услуг обмена, если вы принимаете их, поставьте галочку в соответствующем поле и нажмите кнопку «Создать заявку».</li>\n	<li>Оплатите заявку.  Для этого следует совершить перевод необходимой суммы, следуя инструкциям на нашем сайте.</li>\n	<li>После выполнения указанных действий, система переместит Вас на страницу «Состояние заявки», где будет указан статус вашего перевода.</li>\n</ol>[:ru_RU][en_US:]For exchange you need to follow a few steps:\n<ol>\n	<li>Fill in all the fields of the form submitted. Click «Exchange».</li>\n	<li>Read the terms of the agreement on exchange services, when accepting it, please tick the appropriate field and press the button «Create order».</li>\n	<li>Pay for the order. To do this, transfer the necessary amount, following the instructions on our website.</li>\n	<li>After this is done, the system will redirect you to the «Order status» page, where the status of your transferwill be shown.</li>\n</ol>[:en_US]'),
(61, 'naps_temp', 'timeline_txt', '[ru_RU:]Данная операция производится в автоматическом режиме.[:ru_RU][en_US:]This operation is performed automatically.[:en_US]'),
(62, 'naps_temp', 'status_new', '[ru_RU:]<ol>\n 	<li>Авторизуйтесь в платежной системе XXXXXXX;</li>\n 	<li>Переведите указанную ниже сумму на кошелек XXXXXXX;</li>\n 	<li>Нажмите на кнопку \"Я оплатил заявку\";</li>\n 	<li>Ожидайте обработку заявки оператором.</li>\n</ol>[:ru_RU][en_US:]<ol>\n 	<li> Log in to the system XXXXXXX;</li>\n 	<li>Turn the amounts shown below on the wallet XXXXXXX;</li>\n 	<li>Click on the \"I paid bid\";</li>\n 	<li>Expect the processing of the application by the operator.</li>\n</ol>[:en_US]'),
(63, 'naps_temp', 'status_cancel', '[ru_RU:]Заявка была отменена пользователем.[:ru_RU][en_US:]Order has been canceled by the user.[:en_US]'),
(64, 'naps_temp', 'status_delete', '[ru_RU:]Заявка была удалена.[:ru_RU][en_US:]Order has been deleted.[:en_US]'),
(65, 'naps_temp', 'status_payed', '[ru_RU:]Подтверждение оплаты принято.\nВаша заявка обрабатывается оператором.[:ru_RU][en_US:]Confirmation of payment accepted.\nYour order is being processed by the operator.[:en_US]'),
(66, 'naps_temp', 'status_realpay', '[ru_RU:]Подтверждение оплаты принято.\nВаша заявка обрабатывается оператором.[:ru_RU][en_US:]Confirmation of payment accepted.\nYour request is being processed by the operator.[:en_US]'),
(67, 'naps_temp', 'status_verify', '[ru_RU:]Подтверждение оплаты принято.\nВаша заявка обрабатывается оператором.[:ru_RU][en_US:]Confirmation of payment accepted.\nYour order is being processed by the operator.[:en_US]'),
(68, 'naps_temp', 'status_error', '[ru_RU:]В заявке есть ошибки. Обратитесь в техническую поддержку.[:ru_RU][en_US:]In the bid there is an error. Please contact technical support.[:en_US]'),
(69, 'naps_temp', 'status_success', '[ru_RU:]Ваша заявка выполнена.\nБлагодарим за то, что воспользовались услугами нашего сервиса.\nОставьте, пожалуйста, <a href=\"/reviews/\">отзыв</a> о работе нашего сервиса![:ru_RU][en_US:]Your order is complete.\nThank you for using the services of our service.\nPlease leave <a href=\"/reviews/\">review</a> review of the work of our service![:en_US]'),
