(12, 1, '2015-10-22 17:31:50', '2015-10-22 14:31:50', '[ru_RU:]1. Зарегистрированные пользователи получают право использовать накопительную систему скидок при совершение обмене:\r\n<ul>\r\n	<li>0-99 USD - 1%</li>\r\n	<li>100-999 USD - 2%</li>\r\n	<li>1000-4999 USD - 3%</li>\r\n	<li>5000- 9999 USD - 4%</li>\r\n	<li>10000-19999 USD - 5%</li>\r\n	<li>свыше 20000 USD - 6%</li>\r\n</ul>\r\n2. Начисления и выплаты по партнерской программе ведутся в долларах (WebMoney WMZ).\r\n\r\n3. Минимальная сумма для снятия заработанных денег с партнерского счета составляет 5 USD.\r\n\r\n4. За каждый совершенный обмен по вашей партнерской ссылке вы получает вознаграждение в размере от 1% до 6% от суммы обмена. Процент отчислений зависит от суммы совершенных обменов по вашей партнерской ссылке:\r\n<ul>\r\n	<li>0-99 USD - 1%</li>\r\n	<li>100-999 USD - 2%</li>\r\n	<li>1000-4999 USD - 3%</li>\r\n	<li>5000- 9999 USD - 4%</li>\r\n	<li>10000-19999 USD - 5%</li>\r\n	<li>свыше 20000 USD - 6%</li>\r\n</ul>\r\n4.1. Указанные значения партнерских вознаграждений быть со временем изменены. При этом все заработанные средства сохраняются на счете с учетом действовавших ранее ставок.\r\n\r\n5. На странице, где вы публикуете о нас информацию должно быть четко указано об услугах, предоставляемых нашим сайтом. В рекламных текстах запрещаются любые упоминания о наличии «бесплатных бонусов» на нашем сайте.\r\n\r\n6. Запрещается размещать партнерскую ссылку:\r\n<ul>\r\n	<li>в массовых рассылках писем (СПАМ);</li>\r\n	<li>на сайтах, принудительно открывающих окна браузера, либо открывающих сайты в скрытых фреймах;</li>\r\n	<li>на сайтах, распространяющих любые материалы, прямо или косвенно нарушающие законодательство РФ;</li>\r\n	<li>на сайтах, публикующих списки сайтов с «бесплатными бонусами»;</li>\r\n	<li>на веб-страницах, закрытых от публичного просмотра с помощью авторизации (различные социальные сети, закрытые разделы форумов и т.п.).</li>\r\n</ul>\r\nСайты, нарушающие одно или несколько вышеперечисленных правил, будут занесены в черный список нашей партнерской программы. Оплата за посетителей, пришедших с подобных сайтов производиться не будет.\r\n\r\n7 . При несоблюдении данных условий аккаунт нарушителя будет заблокирован без выплат и объяснения причин.\r\n\r\n8. Партнер несет полную ответственность за сохранность своих аутентификационных данных (логина и пароля) для доступа к аккаунту.\r\n\r\n9. Данные условия могут изменяться в одностороннем порядке без оповещения участников программы, но с публикацией на этой странице.\r\n<h1>Регистрация</h1>\r\nПожалуйста, внимательно и аккуратно заполните все поля регистрационной формы. На указанный вами e-mail будет выслано уведомление о регистрации.\r\n\r\n[register_page][:ru_RU][en_US:]1. Registered users have the right to use a progressive discount system when committing the exchange:\r\n<ul>\r\n	<li>0-99 USD — 1%</li>\r\n	<li>100-999 USD — 2%</li>\r\n	<li>1000-4999 USD — 3%</li>\r\n	<li>5000- 9999 USD — 4%</li>\r\n	<li>10000-19999 USD — 5%</li>\r\n	<li>over 20000 USD — 6%</li>\r\n</ul>\r\n2. Calculation and payoff within an affiliate program are maintained in United States dollars (USD).\r\n\r\n3. The minimum amount for the withdrawal of money earned from an affiliate account is 5 USD.\r\n\r\n4. For every exchange made using your affiliate link, you receive a reward at a rate of 1% to 6% of the amount exchanged. The percentage depends on the amount of exchanges made using your affiliate link:\r\n<ul>\r\n	<li>0-99 USD — 1%</li>\r\n	<li>100-999 USD — 2%</li>\r\n	<li>1000-4999 USD — 3%</li>\r\n	<li>5000- 9999 USD — 4%</li>\r\n	<li>10000-19999 USD — 5%</li>\r\n	<li>over 20000 USD — 6%</li>\r\n</ul>\r\n4.1. These values ​​of affiliate rewards may be changed from time to time. In this case, all earnings are retained in the account taking into account the previous rates.\r\n\r\n5. It should be clearly stated on the services provided by our site on the page where you post information about us. In advertising texts, it is prohibited to mention of a \"free bonus\" being available on our site.\r\n\r\n6. It is prohibited to place an affiliate link:\r\n<ul>\r\n	<li>in mass mail (spam);</li>\r\n	<li>on sites, forcing to open a browser window, or opening sites in a hidden frame;</li>\r\n	<li>on sites distributing any materials that, directly or indirectly, violate the laws of the Russian Federation;</li>\r\n	<li>on sites publishing lists of sites with \"free bonuses\";</li>\r\n	<li>on web pages, enclosed from public view by means of authorization (various social networks, closed sections of forums, etc.).</li>\r\n	<li>Sites that violate one or more of the above rules will be blacklisted for our affiliate program. There will be no payoffs for visitors linked from these sites.</li>\r\n</ul>\r\n7 . When failing to comply with these terms and conditions, your account will be blocked without making payoffs and explanation.\r\n\r\n8. An affiliate is solely responsible for the safety of its credentials (username and password) to access the account.\r\n\r\n9. These terms and conditions may be changed unilaterally without notifying participants of the program, but with the publication on this page.\r\n\r\n[register_page][:en_US]', '[ru_RU:]Регистрация[:ru_RU][en_US:]Registration[:en_US]', '', 'publish', 'closed', 'closed', '', 'register', '', '', '2024-04-05 23:11:07', '2024-04-05 20:11:07', '', 0, 'http://premiumexchanger.ru/register/', 0, 'page', '', 0),
